import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <Router>
      <div className="min-h-screen bg-gray-50">
        <Routes>
          <Route path="/" element={<h1 className="text-3xl font-bold text-center mt-10">AgriQual</h1>} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
